/**
 * Discord Send Voice as User (Self-bot)
 * Sends a voice note FROM YOUR ACCOUNT to new UGC creators
 * Uses FormData with IS_VOICE_MESSAGE flag and real waveform
 */

import { serve } from "https://deno.land/std@0.168.0/http/server.ts"
import { decode as base64Decode } from "https://deno.land/std@0.168.0/encoding/base64.ts"

const DISCORD_USER_TOKEN = Deno.env.get('DISCORD_USER_TOKEN')!

const corsHeaders = {
  'Access-Control-Allow-Origin': '*',
  'Access-Control-Allow-Headers': 'authorization, x-client-info, apikey, content-type',
}

// Exact values from the original voice message
const VOICE_DURATION_SECS = 48.060001373291016
const VOICE_WAVEFORM = ""

async function sendVoiceAsUser(
  channelId: string,
  voiceData: Uint8Array
): Promise<{ success: boolean; error?: string }> {
  try {
    const formData = new FormData()
    
    // Payload with IS_VOICE_MESSAGE flag (8192) and real metadata
    const payload = {
      flags: 8192,
      attachments: [{
        id: '0',
        filename: 'voice-message.ogg',
        duration_secs: VOICE_DURATION_SECS,
        waveform: VOICE_WAVEFORM
      }]
    }
    formData.append('payload_json', JSON.stringify(payload))
    
    // Attach the voice file
    const blob = new Blob([voiceData], { type: 'audio/ogg' })
    formData.append('files[0]', blob, 'voice-message.ogg')

    const url = `https://discord.com/api/v10/channels/${channelId}/messages`
    const response = await fetch(url, {
      method: 'POST',
      headers: { Authorization: DISCORD_USER_TOKEN },
      body: formData,
    })

    if (!response.ok) {
      const error = await response.text()
      console.error('Failed to send voice:', response.status, error)
      return { success: false, error: `${response.status}: ${error}` }
    }
    
    return { success: true }
  } catch (error) {
    console.error('Error:', error)
    return { success: false, error: error instanceof Error ? error.message : 'Unknown error' }
  }
}

const VOICE_NOTE_BASE64 = ""


serve(async (req) => {
  if (req.method === 'OPTIONS') {
    return new Response(null, { headers: corsHeaders })
  }

  try {
    const body = await req.json()
    const { channelId, userName } = body

    if (!channelId) {
      return new Response(
        JSON.stringify({ success: false, error: 'Missing channelId' }),
        { status: 400, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
      )
    }

    if (!DISCORD_USER_TOKEN) {
      return new Response(
        JSON.stringify({ success: false, error: 'DISCORD_USER_TOKEN not configured' }),
        { status: 500, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
      )
    }

    console.log(`Sending voice note to channel ${channelId} for ${userName || 'unknown'}`)

    const voiceData = base64Decode(VOICE_NOTE_BASE64)
    console.log(`Voice loaded: ${voiceData.length} bytes`)

    const result = await sendVoiceAsUser(channelId, voiceData)

    if (!result.success) {
      return new Response(
        JSON.stringify({ success: false, error: result.error }),
        { status: 500, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
      )
    }

    return new Response(
      JSON.stringify({ success: true, message: `Voice note sent to ${userName || channelId}`, channelId }),
      { headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
    )

  } catch (error) {
    console.error('Error:', error)
    return new Response(
      JSON.stringify({ success: false, error: error instanceof Error ? error.message : 'Unknown error' }),
      { status: 500, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
    )
  }
})
